  "description": [
        "Excepcional Casa de Estilo y magnifica Historia. Petit Hotel, en exclusiva ubicación de Belgrano, frente al Paseo del Angel. Exclusivo para uso diplomático / profesional / comercial. ",
        "En PB: gran hall recibidor con entrada peatonal/vehicular. Un despacho al frente, gran salón al contrafrente con salida a jardín. Dependencia de servicio. Cocina y Baño para personas con movilidad reducida. ",
        "En 1er piso: Salón al frente. Despacho exclusivo con salida a balcón de estilo con vista al 'Paseo del Ángel'. Gran salón al contrafrente. y Despacho en ubicación central. 2 baños (hombre/mujer) ",
        "En 2do piso: Un despacho. Dos habitaciones destinadas a archivo. Dos baños tipo vestuario con duchas (hombre / mujer) y Terraza Conociendo la propiedad en Detalle: ",
        "La propiedad cuenta con entrada peatonal y/o vehicular a un cómodo hall recibidor. En esta ubicación de la propiedad se aprecia una escalera de madera original en impecable estado de conservación y mantenimiento. Un gran Vitraux deja entrar la luz natural al centro del hall. En misma planta cuenta cuenta con un despacho con vista al frente, y un gran salón con salida al jardín del contrafrente. Un baño para personas con movilidad reducida. El sector de cocina cuenta con un espacio cerrado el cual ha conseguido ser un despacho adicional. ",
        "Ascendiendo al primer piso llegamos a un gran salón con muebles de categoría, vista al frente y acceso al exclusivo despacho con salida a balcón estilo clásico con vista al Paseo del Ángel. En misma planta encontramos dos baños (hombre/mujer). Un gran salón al contrafrente y un despacho en el centro de la propiedad. ",
        "Ascendiendo a la segunda planta encontramos un nuevo despacho con vista al contrafrente, dos espacios de archivo, dos baños equipados con duchas (hombre/mujer), y acceso a gran terraza orientada al frente. "
